INSERT INTO weather_data_siemens (
	observation_date,
	observation_time,
	location_name,
	longitude,
	latitude
) VALUES (
	((('${date_utc_formatted}'::date + '${time_utc}'::time) AT TIME ZONE 'UTC') AT TIME ZONE '${local_timezone}')::date
	,((('${date_utc_formatted}'::date + '${time_utc}'::time) AT TIME ZONE 'UTC') AT TIME ZONE '${local_timezone}')::time
	,'${location_name}'
	,${longitude}
	,${latitude}
);

INSERT INTO ${table} (
	date,
	time,
	temperature_2m_c,
	precipitation_mm,
	rain_mm,
	snowfall_cm,
	condition_code,
	condition,
	sealevel_pressure_hPa,
	windspeed_10m_m_s,
	windspeed_100m_m_s,
	windgusts_10m_m_s,
	longitude,
	latitude,
	location_name
) VALUES (
	'${date:replaceNull('NULL')}'
	,'${time:replaceNull('NULL')}'
	,${temperature_2m_c:replaceNull('NULL')}
	,${precipitation_mm:replaceNull('NULL')}
	,${rain_mm:replaceNull('NULL')}
	,${snowfall_cm:replaceNull('NULL')}
	,${condition_code:replaceNull('NULL')}
	,'${condition:replaceNull('NULL')}'
	,${sealevel_pressure_hPa:replaceNull('NULL')}
	,${windspeed_10m_m_s:replaceNull('NULL')}
	,${windspeed_100m_m_s:replaceNull('NULL')}
	,${windgusts_10m_m_s:replaceNull('NULL')}
	,${longitude:replaceNull('NULL')}
	,${latitude:replaceNull('NULL')}
	,'${location_name:replaceNull('NULL')}'
);

INSERT INTO ${table} (
	observation_date,
	observation_time,
	location_name,
	technology,
	longitude,
	latitude,
	visibility_km,
	source	
) VALUES (
	'${start_date}'
	,'${observation_time}'
	,'${location_name}'
	,'${technology}'
	,${longitude}
	,${latitude}
	,${visibility_km:replaceNull('NULL')}
	,'${source:replaceNull('NULL')}'
);
